import React, { FC, useState, useEffect } from 'react';
import './App.css';
import Search from "../searchmm/searchmm"


interface CatalogModel {
  id: number;
  is_actual_price: boolean;
  is_current: boolean;
  photo_url: string;
  plate_count: number;
  price_avg: number;
  price_max: number;
  price_min: number;
  slug: string;
  title: string;
  vendor_id: number;
  year_from: number;
  year_to: number | null;
  years: string;
  description?: string; 
}

interface MainModel {
  catalog_model: CatalogModel;
  full_title: string;
  id: number;
  slug: string;
  title: string;
}




function SearchMM() {

  const [carData, setCarData] = useState<Car | null | string>(null);
  const [SearchVin, setVin] = useState<string>(" ");
  const [SearchMark, setMark] = useState<string>(" ");



  console.log(carData);

   


  return (
    <div className="App">
          <Search setDataFromSearch = {setCarData}></Search>
          {carData != null && (
              <div></div>
          )}
    </div>
  );
}

export default SearchMM;
